graphql.query:
mutation checkin {
  checkin {
    checkedIn
    ok
    error
    __typename
  }
}

query codingChallengeMedal($year: Int!, $month: Int!) {
  dailyChallengeMedal(year: $year, month: $month) {
    name
    config {
      icon
      __typename
    }
    __typename
  }
  activeDailyCodingChallengeQuestion {
    link
    __typename
  }
}

query trendingDiscuss($first: Int!) {
  cachedTrendingCategoryTopics(first: $first) {
    id
    title
    post {
      id
      creationDate
      contentPreview
      author {
        username
        isActive
        profile {
          userAvatar
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

query upcomingContests {
  upcomingContests {
    title
    titleSlug
    startTime
    duration
    __typename
  }
}
